If((clkIntern_next_falling & ~slaveSelectWaitRequired)._eq(1),
    If(txInitialized._eq(1),
        txReg_next(Concat(sig_3, Bits(1, force_vector=True).from_py(0))),
        If(endOfWordDelayed._eq(1),
            txInitialized_next(0)
        ).Else(
            txInitialized_next(txInitialized)
        )
    ).Else(
        txInitialized_next(1),
        txReg_next(data_dout)
    )
).Elif(endOfWordDelayed._eq(1),
