).Elif((~endOfWordDelayed & data_vld)._eq(1),
    endOfWordtimerCntr256_next((endOfWordtimerCntr256._reinterpret_cast(Bits(8, signed=False)) - 1)._reinterpret_cast(Bits(8)))
).Else(
    endOfWordtimerCntr256_next(endOfWordtimerCntr256)
)
